// src/components/JobResultsPage.jsx
import React from "react";
import { useLocation, Link } from "react-router-dom";

function JobResultsPage() {
  const location = useLocation();
  const data = location.state || {};

  return (
    <div style={{ maxWidth: "600px", margin: "auto", padding: "20px" }}>
      <h2>Job Results</h2>
      <p><strong>Qualification:</strong> {data.qualification}</p>
      <p><strong>Preferred Location:</strong> {data.location}</p>
      <p><strong>Job Role:</strong> {data.jobRole}</p>
      <p><strong>Timing:</strong> {data.timing}</p>
      <p><strong>Salary Expectation:</strong> ₹{data.salary}</p>
      <p><strong>Night Shift:</strong> {data.nightShift}</p>

      <h3>Sample Job Found:</h3>
      <p>Job Role: {data.jobRole || "Intern"}</p>
      <p>Company: XYZ Pvt Ltd</p>
      <p>Location: {data.location || "Kolkata"}</p>
      <p>Salary: ₹{data.salary || 8000}</p>

      <Link to="/"><button>Back to Home</button></Link>
    </div>
  );
}

export default JobResultsPage;
